import "../styles/method.css";
import React from "react";
import randomImage from "../img/random.png";
import getDataFunc from "./List";

export const Method = (props) => {
  const myFunction = () => {
    console.log("CLICKED");
  };
  const riceClickAction = () => {
    fetch(`http://localhost:8080/table/resetIsWaiting`, { method: "PUT" })
      .then((res) => res.json())
      .then(() => {
        getDataFunc(props.allMenuSet);
      });
  };

  return (
    <div className="method">
      Let's choose!!
      <button id="rice" onClick={riceClickAction}>
        ごはん
      </button>
      <button>パスタ</button>
      <button>
        <img src={randomImage} alt="random" onClick={myFunction} />
      </button>
    </div>
  );
};
